package com.citi.retail.optima.etl.common.model.cache;

public class ReportCycleDomain {

	private Long rptCycId;
	private String rptCycNm;
	private String rptCycQtr;
	private String rptCycYr;

	public Long getRptCycId() {
		return rptCycId;
	}

	public void setRptCycId(Long rptCycId) {
		this.rptCycId = rptCycId;
	}

	public String getRptCycNm() {
		return rptCycNm;
	}

	public void setRptCycNm(String rptCycNm) {
		this.rptCycNm = rptCycNm;
	}

	public String getRptCycQtr() {
		return rptCycQtr;
	}

	public void setRptCycQtr(String rptCycQtr) {
		this.rptCycQtr = rptCycQtr;
	}

	public String getRptCycYr() {
		return rptCycYr;
	}

	public void setRptCycYr(String rptCycYr) {
		this.rptCycYr = rptCycYr;
	}

}
